import React from 'react';
import ProjectCard from './ProjectCard';

const Dashboard = ({ projects }) => {
  return (
    <div className="dashboard">
      {projects.map((project) => (
        <ProjectCard key={project.id} project={project} />
      ))}
    </div>
  );
};

export default Dashboard;
